About lastnight…. It was so amazing. We sold out in 30minutes (cans) 

we put so much work and effort to this new project “La Chacalosa” thank you for all your love and support 🙏🏼🥰 we will be restocking the cans next week so stay tune. 

@jacqierivera @pattygregory_ @_hairdresseronfire_ @evilm80

Lastnight was a huge success! Thank you all for being there and supporting all these crazy ideas that then become a reality. For loving @jennirivera as much as you do and also her children. @jacqierivera I am so beyond proud of you, to witness how much people love you over and over again is just a privilege. You have bloomed 🌻 so much in this last year and I’m just so beyond proud 🥲. The number one thing everyone would tell me lastnight is how humble and loving you are, how you made everyone feel special. This is not something that can be taught it’s something your momma instilled in you. Thank you @jacqierivera for allowing me to be by your side. Te amo chola sin barrio. 🫶🏻🖤 

Thank you;
@pattygregory_ @cervezacito @yourstrulybyyari @l_aguilar23 @officialfranky1503 @crism_52 @eatsaborcito

“A friend is one who overlooks your broken fence and admires the flowers in your garden.” — Unknown

If either of them falls down, one can help the other up. But pity anyone who falls and has no one to help them up. — Ecclesiastes 4:10

@jacqierivera Happy #nationalbestfriendday thank you for being there all this time, I appreciate our friendship…our love, respect, boundaries, likes, dislikes and all the ups and downs we been through together! I don’t know where I would be today without you and our friendship! You are one of a kind, you really are! Thank you for seeing my garden and even my broken fence! I’m blessed that I’m not alone when I fall! Te amo chola sin barrio! #tomanymoreyearsoffriendship 👯‍♀️🌻🌵💛💜
